@Tạ Thu Thâu
- (1906-1945)
- Nhà hoạt động chính trị, nhà báo sinh năm 1906 ở xã Tân Bình, huyện Lấp Vò, tỉnh Long Xuyên (nay thuộc xã Tân Bình, huyện Thạnh Hưng, Đồng Tháp), mất năm 1945 tại Quảng Ngãi.Xuất thân trong một gia đình thợ mộc, nhà rất nghèo, ngay từ bé ông phải chăn vịt giúp gia đình. Thuở nhỏ, ông học tại trường làng. Năm 13 tuổi, học lớp nhất ông đã phải đi dạy tự giúp gia đình. Sau đó ông thi đậu, được cấp học bổng vào trường trung học Chasseloup Laubat. Tốt nghiệp trung học, ông dạy tư tại các trường Nguyễn Xích Hồng, Huỳnh Khương Ninh cùng các bạn Nguyễn Phi Oanh, Phan Văn Hùm...Năm 1927, ông cùng Nguyễn Khánh Toàn xuất bản tờ báo Le Nhà Quê làm cơ quan tranh đấu chống thực dân, nhưng chẳng bao lâu báo bị tịch thu và người đứng tên báo (Nguyễn Khánh Toàn) bị truy tố. Cuối năm này ông sang Pháp học tại trường Đại học Sorbonne. Tại đây ông kết thân với một số chiến sĩ thuộc cánh tả Đảng xã hội Pháp. Đang học ngành toán, thì tại nước nhà thực dân Pháp khủng bố trắng cuộc khởi nghĩa Yên Bái, ông cùng một số sinh viên tiến bộ biểu tình phản đối Chính phủ Pháp trước điện Elysée. Cuộc biểu tình bị đàn áp ông và một số sinh viên bị trục xuất khỏi Pháp vì thực dân cho rằng ông đồng lõa với những người tham gia cuộc khởi nghĩa Yên Bái. Năm 1930, về đến Sài Gòn, ông tham gia các tổ chức yêu nước cùng Nguyễn An Ninh, Nguyễn Văn Tạo, Dương Bạch Mai chủ trương báo La Lutte (Tranh Đấu), báo La Clothe Felée (Chuông Rè) chống thực dân giành độc lập dân tộc. O_ng thường diễn thuyết về các vấn đề triết học, biện chứng Pháp ở Hội Đức trí thể dục (gọi tắt là Samipic) thu hút rất nhiều thính giá trí thức và giới yêu nước. Năm 1936, ông ứng cử vào Hội đồng thành phố Sài Gòn trong danh sách "Mặt trận Vô sản Thống nhất" cùng các ông Nguyễn Văn Tạo, Dương Bạch Mai đắc cử vẻ vang trong thời gian này, ông cùng một số tổ chức chính trị yêu nước vận động lập "Đông Dương Đại hội" liên hiệp các lực lượng yêu nước kể cả những người Cộng sản trên mặt trận chống Pháp. Phong trào cuối cùng tan rã do sự lật lọng của Pháp và các đảng tay sai, ông bị bắt cùng với Nguyễn An Ninh và các nhà yêu nước khác. Ông là người có lập trường Tờ-rốt-kít chống lại đường lối của Đảng Cộng sản. Năm 1943, ông được trả tự do nhưng bị quản thúc tại Tân Uyên (Biên Hòa). Cách mạng tháng Tám thành công, trên đường ra Hà Nội, vừa đến Quảng Ngãi, ông bị giết vào cuối năm 1945

